import photoDefault from '../../images/default-photo.jpg'

const UserItem = ({email, name, phone, photo, position}) => {
    return(
        <li>
            <img 
                src={photo} 
                alt="user-avatar"
                width="70px"
        height="70px" 
                onError={({currentTarget}) => {
                    currentTarget.onerror = null;
                    currentTarget.src = photoDefault;
                }}
            />
            <h3>{name}</h3>
            <h4>{email}</h4>
            <p>{phone}</p>
            <p>{position}</p>
        </li>
    )
}

export default UserItem;
